textOriginal:
Na arte cada significante é próprio, eu percebo (perceptrons) desta forma hoje: 
“Você diz: O que o tempo espera de sua primavera?” Eu percebo: Séries temporais dos ambientes de aprendizado;
“Eu digo: Que espera pelo galho que floresce.” Eu percebo: Os pontos temporais da expressão, os marcos da trajetória e vetoriais complexas, o regalo da lógica afetiva;
“Pois você é diamante arquitetura de doce cheiro.” Eu percebo: A singularidade conectada e transferindo as funções complexas, não na probatória algébrica mas no campo não palpável da lógica afetiva sinestésico, ponto de saída, objeto tornando-se sujeito das orientações e respostas complexas; 
“Que não sabe porque cresce.” Eu percebo: A transferência da complexidade não decompõem em partes os objetos pois para tal perderia suas identidades, neste ponto o  estranho da máquina é sempre dirimido, portanto há vários caminhos complexos para o mesmo lugar (saída). Espero ter interagido. ♥️♠️🌹
